/**
 * Stylesheet for the trophy page.
 * 
 * Authors: ?
 */

import { StyleSheet } from 'react-native';

export default StyleSheet.create({
    spinnerTextStyle: {
        color: '#FFF'
    },
    spinnerContainer: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
        backgroundColor: '#F5FCFF'
    },
    container: {
        backgroundColor: '#f3ebe1',
        marginTop: 0,
        alignItems: 'center',
    },
    progressbar: {
        marginTop: 13,
    },
    images: {
        width: 75, height: 75
    }
    ,
    buttonStyle: {
        marginTop: 10,
        marginBottom: 10,
        paddingBottom: 10,
        paddingLeft: 10,
        paddingRight: 10,
        backgroundColor: '#212143',
        borderRadius: 10,
        borderColor: '#fff',
    },
    buttonTextStyle: {
        fontSize: 20,
        textAlign: 'center',
        fontWeight: '100',
        marginBottom: 0,
        color: '#fff',
    },
    headerStyle: {
        fontSize: 36,
        textAlign: 'center',
    },
    textStyle: {
        fontSize: 20,
        textAlign: 'center',
        fontWeight: '100',
        marginBottom: 0,
    },
    box: {
        fontSize: 36,
        textAlign: 'center',
        fontWeight: '100',
        borderWidth: 2,
        marginLeft: 20,
        marginRight: 20,
    },
    elementsContainer: {
        backgroundColor: '#ecf5fd',
        marginLeft: 24,
        marginRight: 24,
        marginBottom: 24,
    },
});
